function App() {
	return (
		<Router>
			<Header />
			<Routes>
				<Route path='/stream' element={<Stream />} />
				<Route path='/homeworks' element={<Homeworks />} />
				<Route path='/users' element={<Users />} />
				<Route path='/' element={<Stream />} /> {/* Default route */}
			</Routes>
		</Router>
	)
}

export default App
